import React from 'react';
import classes from "./ClientPlate.module.css";
import ClientService from "../../../API/ClientService";

const ClientPlate = ({item, onClick, ...props}) => {
    return (
        <div onClick={onClick}>
            <article className={classes.newsPlate}>
                <label className={classes.title}>{item.last_name}</label>
                {/*<label className={classes.summary}>{item.stars}</label>*/}
                {/*<label className={classes.summary}>{item.cost_per_day}</label>*/}
                {/*<label className={classes.summary}>{item.country}</label>*/}
            </article>
        </div>
    );
};

export default ClientPlate;
